import React, { Component } from 'react';

class SectionHeader extends Component {

    render() { 
        const { headerText, headerLink } = this.props;
        
        return (
            <div className="section-header"></div>
          );
    }
}
 
export default SectionHeader;
<div className="section-header"></div>
